import React from 'react'
import MessagesBox from './components/MessagesBox.jsx';

function App() {
    const [apiData, setApiData] = React.useState({});
    React.useEffect(() => {
        fetch("http://127.0.0.1:8000/acess/treinamento_final31.jsonl/0", {
            method: "GET"
        })
        .then(response => response.json())
        .then(data => {
            setApiData(data ? data : {})
        })
        .catch(err => console.log(err));
    }, []);


    const messagesComponents = [];
    if (apiData != null) {
        messagesComponents = apiData.jsonline.messages.map(message => {
            return <MessagesBox text={JSON.stringify(message.content)} role={message.role} />
        })
    }

    return(
        <p>{messagesComponents ? messagesComponents : "Carregando..."}</p>
    )
}

export default App;
